import React from "react";
import Base from "./../../components/Base";
import AddPost from "../../components/AddPost";
import { Container } from "reactstrap";
const Userdashboard = () => {
  return (
    <Base>
      <Container>
        <AddPost />
      </Container>
    </Base>
  );
};

export default Userdashboard;
